### Description of change
there are different formats with which sequelize-oracle is supporting the connection parameters.
example :

```js
var sequelize = new Sequelize('mysql://localhost:3306/database', {})
var sequelize = new Sequelize('database', 'username', 'password')

//need to add one more 
Sequelize("(DESCRIPTION =(RETRY_COUNT = 10)(RETRY_DELAY = 5)(ADDRESS_LIST = (ADDRESS = . . .)(ADDRESS = . . .))(CONNECT_DATA = (SERVICE_NAME = ha_svc)))))")",{username:"admin",password:"pass"});
```

and more. but in the Sequelize() constructor. we are privileged the user to use connection using URI and individual strings too, but ORACLE's tnsname.ora format is not supported internally but there are few flows in connecting it.

changes : 
sequelize.js file
```js
// this is newly added to check does the argument[0] contains DESCRIPTION then we can use 
// it as connectString value directly. also we need credntials to connect.
 if(urlParts.pathname.indexOf("DESCRIPTION")>=0){
      database = urlParts.pathname;
      options.dialect = "oracle";
      username = options.username;
      password = options.password;
    }
    else{
      // SQLite don't have DB in connection url
      if (urlParts.pathname) {
        database = urlParts.pathname.replace(/^//, '');
      }
      options.dialect = urlParts.protocol.replace(/:$/, '');
      options.host = urlParts.hostname;

      if (urlParts.port) {
        options.port = urlParts.port;
      }
      if (urlParts.auth) {
        username = urlParts.auth.split(':')[0];
        password = urlParts.auth.split(':')[1];
      }
    }
```
